import React from 'react';
import { useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const NavWrapper = styled.nav`
  background-color: #333;
  color: white;
  padding: 1rem;
`;

const Logo = styled.img`
  width: 80px;
`;

const NavList = styled.ul`
  list-style: none;
  display: flex;
  justify-content: flex-end;
  align-items: center;
  margin: 0;
`;

const NavItem = styled.li`
  margin: 0 1rem;
  cursor: pointer;
  font-size: 20px;
`;


const Navbar = () => {
    const token = useSelector((state)=>{ return state.token});
  return (
    <NavWrapper>
      {/* <Logo src="LogoAssets/Logo2.png" alt="Logo" /> */}
      <NavList>
        <NavItem>Home</NavItem>
        <NavItem>Events</NavItem>
        <NavItem>Jobs</NavItem>
        <NavItem>Contact</NavItem>
        {token!==null ? <button>Profile</button>:<NavItem><Link style={{color:"#fff",textDecoration:"none"}} to="/login/user">Login/Signup</Link></NavItem>}  
      </NavList>
    </NavWrapper>
  );
};

export default Navbar;
